(119, 8, 'construcao', 'Construção e reforma em geral'),
(120, 8, 'texto-construcao', 'Atuamos na construção, do zero ao acabamento, em ampliações e reformas de imóveis residenciais ou comerciais. Fazemos, também, assentamento de todos os tipos de pedra e cuidamos da parte elétrica e hidráulica da sua casa.'),
(121, 8, 'reparos', 'Reparos'),
(122, 8, 'texto-reparos', 'Precisa de algum reparo ou manutenção no seu imóvel? Nós temos a solução perfeita e garantimos ótimos resultados, pois contamos com uma equipe comprometida em entregar os melhores resultados.'),
(123, 8, 'projetos', 'Projetos em geral'),
(124, 8, 'texto-projetos', 'Executamos todo tipo de projeto, do mais simples ao mais ousado, com mão de obra especializada, bem treinada e com toda a experiência de quem já está no mercado há décadas.'),
