(127, 8, 'descritivo-empresa', 'A G.O. Alvarenga nasceu da necessidade de preencher uma lacuna na área da construção civil em Extrema e no Sul de Minas Gerais, já que a região se encontra em expansivo crescimento, onde muitas indústrias e galpões logísticos fincaram suas raízes, promovendo grande desenvolvimento do setor.\r\nA chegada da mão de obra na cidade aumentou a demanda na procura por imóveis para moradia e, consequentemente, aqueceu o setor turístico, o que resultou no avanço sistemático da área urbana e de módulos rurais no município.'),
